import React from 'react';
import Navbar from './components/Navbar';
import HeroSection from './components/HeroSection';
import EventCard from './components/EventCard';
import Footer from './components/Footer';
import './App.css';

const App = () => {
  return (
    <div className="App">
      <Navbar />
      <HeroSection />
      <div className="event-section">
        <EventCard image="path_to_image1" title="Event 1" />
        <EventCard image="path_to_image2" title="Event 2" />
        <EventCard image="path_to_image3" title="Event 3" />
        <EventCard image="path_to_image4" title="Event 4" />
      </div>
      <Footer />
    </div>
  );
};

export default App;
